import './css/App.css';
import Admin from './Admin'
import { BrowserRouter,Route,Routes } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route exact path="/admin" element={<Admin/>}/>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
